(106, 'success', 'Tạo mới', 'Thêm mới điểm nóng thông tin', 'linkHotspot', '{\n  \"sceneId\": \"011538aa-ac83-43d7-8781-4f3ac821a696\",\n  \"yaw\": 4.191508929576392,\n  \"pitch\": -0.006258299649869459,\n  \"type\": \"4\",\n  \"title\": \"Amona Spa\",\n  \"description\": \"<p>Trung t&acirc;m chăm s&oacute;c sức khỏe Amona Spa với di&ecirc;̣n tích khoảng 150 m2 được chia làm 4 ph&ograve;ng trị liệu, Amona Spa tại Kim Th&aacute;i Hotel mang đến trải nghiệm thư gi&atilde;n đẳng cấp với c&aacute;c phương ph&aacute;p trị liệu đa dạng từ ti&ecirc;u chuẩn đến trị liệu chuy&ecirc;n s&acirc;u. Spa dưỡng sinh gi&uacute;p cơ thể thư gi&atilde;n, kh&iacute; huyết lưu th&ocirc;ng, da dẻ hồng h&agrave;o. ch&uacute;ng t&ocirc;i tự h&agrave;o l&agrave; trung t&acirc;m chăm s&oacute;c sức khỏe tốt tại Th&aacute;i Nguy&ecirc;n. Ch&uacute;ng t&ocirc;i được sự tin y&ecirc;u của kh&aacute;ch h&agrave;ng nhờ từ những dịch vụ l&agrave;m đẹp cơ bản đến chuy&ecirc;n s&acirc;u c&ugrave;ng với những trải nghiệm thư gi&atilde;n chăm s&oacute;c sức khỏe chất lượng tuyệt hảo.</p>\\n<p class=\\\"MsoNormal\\\">Amona Spa với những liệu tr&igrave;nh:</p>\\n<p class=\\\"MsoNormal\\\">- Massage cổ vai g&aacute;y chuy&ecirc;n s&acirc;u</p>\\n<p class=\\\"MsoNormal\\\">- Giảm b&eacute;o đ&ocirc;ng y kết hợp c&ugrave;ng m&aacute;y c&ocirc;ng nghệ cao</p>\\n<p class=\\\"MsoNormal\\\">- Gội đầu massage cổ vai g&aacute;y</p>\\n<p class=\\\"MsoNormal\\\">- Massage body</p>\\n<p class=\\\"MsoNormal\\\">- Massage cổ vai g&aacute;y, gan, thận</p>\\n<p class=\\\"MsoNormal\\\">- Massage ch&acirc;n</p>\\n<p class=\\\"MsoNormal\\\">- Bấm huyệt massage n&acirc;ng cơ mặt</p>\\n<p class=\\\"MsoNormal\\\">- Bấm huyệt đả th&ocirc;ng kinh lạc thận, gan, t&ugrave;y</p>\\n<p class=\\\"MsoNormal\\\">- Massage l&agrave;m ấm tử cung v&agrave; buồng trứng</p>\\n<p class=\\\"MsoNormal\\\">- Liệu ph&aacute;p t&aacute;i sinh c&ocirc; b&eacute; to&agrave;n diện</p>\\n<p class=\\\"MsoNormal\\\">- C&acirc;u lạc bộ chăm s&oacute