(239, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Sảnh phòng khách sạn', 'scene', '{\n  \"name\": \"Sảnh phòng khách sạn\",\n  \"slug\": \"sanh_2\",\n  \"description\": \"<p>Kh&aacute;ch sạn Kim Th&aacute;i được đầu tư với quy m&ocirc; 69 ph&ograve;ng c&oacute; diện t&iacute;ch đa dạng v&agrave; phong ph&uacute;, từ 24m2 - 66 m2, ph&ugrave; hợp với mọi nhu cầu của kh&aacute;ch h&agrave;ng. Mang lối kiến tr&uacute;c hiện đại, đầy đủ tiện nghi, nội thất sang trọng, đạt ti&ecirc;u chuẩn tr&ecirc;n 3 sao - Theo ti&ecirc;u chuẩn Quốc Tế.</p>\",\n  \"audioId\": \"clpi50p4k0005dr3n456agg5k\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:45:53.889', '2023-11-28 09:45:53.889'),
(240, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng gia đình', 'scene', '{\n  \"name\": \"Phòng gia đình\",\n  \"slug\": \"4\",\n  \"description\": \"<p>Kh&ocirc;ng gian trong ph&ograve;ng tho&aacute;ng m&aacute;t, sạch sẽ, mỗi ph&ograve;ng đều c&oacute; cửa sổ lớn nh&igrave;n ra kh&ocirc;ng gian b&ecirc;n ngo&agrave;i với xa xa l&agrave; khung cảnh non nước hữu t&igrave;nh đầy thơ mộng, biểu tượng N&uacute;i Voi uy nghi, sừng sững v&agrave; cảnh đẹp lung linh của th&agrave;nh phố khi m&agrave;n đ&ecirc;m bu&ocirc;ng xuống nơi đ&acirc;y. Hơn thế nữa, &nbsp;Kh&aacute;ch sạn Kim Th&aacute;i c&ograve;n lựa chọn c&aacute;ch thiết kế độc đ&aacute;o, thuận tiện cho ph&ograve;ng VIP, Suite trong đ&oacute; ph&ograve;ng kh&aacute;ch v&agrave; ph&ograve;ng nghỉ được t&aacute;ch biệt với diện t&iacute;ch ph&ograve;ng l&ecirc;n đến 66m2. Trang thiết bị th&acirc;n thiện với m&ocirc;i trường v&agrave; tiết kiệm năng lượng sẽ l&agrave;m h&agrave;i l&ograve;ng mọi kh&aacute;ch h&agrave;ng cho d&ugrave; l&agrave; kh&oacute; t&iacute;nh nhất.</p>\",\n  \"audioId\": \"clpi53ylh000xdr3n2onkbglp\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:46:22.981', '2023-11-28 09:46:22.981'),
(241, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng gia đình - phòng riêng', 'scene', '{\n  \"name\": \"Phòng gia đình - phòng riêng\",\n  \"slug\": \"5\",\n  \"description\": \"<p>Ph&ograve;ng ngủ ri&ecirc;ng tư, t&aacute;ch biệt sẽ tạo ra kh&ocirc;ng gian l&atilde;ng mạn v&agrave; đầy sự trải nghiệm mới lạ cho qu&yacute; kh&aacute;ch.</p>\",\n  \"audioId\": \"clpi53yli0011dr3nmqjv4odh\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:46:45.081', '2023-11-28 09:46:45.081'),
(242, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng gia đình - khu bếp ăn', 'scene', '{\n  \"name\": \"Phòng gia đình - khu bếp ăn\",\n  \"slug\": \"3\",\n  \"description\": \"<p>Khu bếp ăn đầy đủ tiện nghi sẽ gi&uacute;p bạn c&oacute; những gi&acirc;y ph&uacute;t nấu nướng đầy th&uacute; vị v&agrave; ấm c&uacute;ng b&ecirc;n gia đ&igrave;nh, nơi gắn kết để c&ugrave;ng thưởng thức những m&oacute;n ăn ngon.</p>\",\n  \"audioId\": \"clpi53ylh000zdr3nawlftn6o\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:47:04.039', '2023-11-28 09:47:04.039'),
(243, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng gia đình - Phòng tắm master', 'scene', '{\n  \"name\": \"Phòng gia đình - Phòng tắm master\",\n  \"slug\": \"6\",\n  \"description\": \"<p>Ph&ograve;ng tắm master l&agrave; điểm nhấn của căn ph&ograve;ng với kh&ocirc;ng gian k&iacute;nh trong suốt, c&oacute; r&egrave;m, đ&aacute;p ứng t&ugrave;y v&agrave;o nhu cầu sử dụng của qu&yacute; kh&aacute;ch. Được thiết kế trong kh&ocirc;ng gian rộng r&atilde;i, c&oacute; bồn tắm, đầy đủ nội thất tiện nghi, hiện đại bậc nhất.&nbsp;</p>\",\n  \"audioId\": \"clpi532jw000ndr3n81faipn9\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:47:37.451', '2023-11-28 09:47:37.451'),
(244, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng SUITE', 'scene', '{\n  \"name\": \"Phòng SUITE\",\n  \"slug\": \"1\",\n  \"description\": \"<p>Suite room l&agrave; sự lựa chọn ho&agrave;n hảo cho gia đ&igrave;nh bạn với đầy đủ sự tiện nghi trong ph&ograve;ng, đảm bảo độ thẩm mỹ cao nhất đến từng chi tiết nhỏ. Suite room sở hữu diện t&iacute;ch rộng r&atilde;i gồm cả ph&ograve;ng nghỉ v&agrave; khu vực tiếp kh&aacute;ch, ph&ugrave; hợp cho những nhu cầu nghỉ dưỡng hạng sang hoặc cho gia đ&igrave;nh dễ d&agrave;ng gắn kết.</p>\",\n  \"audioId\": \"clpi532jv000jdr3nzsl1jnpb\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:48:13.640', '2023-11-28 09:48:13.640'),
(245, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng SUPERIOR', 'scene', '{\n  \"name\": \"Phòng SUPERIOR\",\n  \"slug\": \"2\",\n  \"description\": \"<p>Superior l&agrave; hạng ph&ograve;ng được ch&uacute; trọng về mặt thiết kế, mang những n&eacute;t đặc trưng ri&ecirc;ng nhưng vẫn c&oacute; sự h&agrave;i h&ograve;a với tổng thể kh&ocirc;ng gian chung kh&aacute;ch sạn. Superior mang đến cho kh&aacute;ch h&agrave;ng sự ấm c&uacute;ng v&agrave; gần gũi nhất trong kỳ nghỉ của m&igrave;nh.</p>\",\n  \"audioId\": \"clpi532jw000ldr3njq3bg8cz\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:48:36.607', '2023-11-28 09:48:36.607'),
(246, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng DELUXE', 'scene', '{\n  \"name\": \"Phòng DELUXE\",\n  \"slug\": \"phong_ngu_1_-_2\",\n  \"description\": \"<p>Deluxe room l&agrave; hệ thống c&aacute;c ph&ograve;ng nghỉ tiện nghi với mức gi&aacute; hợp l&yacute; nhưng vẫn mang hơi thở của sự sang trọng v&agrave; s&aacute;ng tạo. Với vẻ đẹp tinh tế, trang nh&atilde; c&ugrave;ng phong c&aacute;ch thiết kế nội thất hiện đại sẽ mang lại kh&ocirc;ng gian nghỉ dưỡng thư th&aacute;i cho qu&yacute; kh&aacute;ch khi đến với Kim Th&aacute;i Hotel ch&uacute;ng t&ocirc;i.</p>\",\n  \"audioId\": \"clpi53ylg000vdr3nsgw78lkk\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:49:05.574', '2023-11-28 09:49:05.574'),
(247, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Sảnh nhà hàng', 'scene', '{\n  \"name\": \"Sảnh nhà hàng\",\n  \"slug\": \"sanh_nha_hang\",\n  \"description\": \"<p>Nh&agrave; h&agrave;ng Kim Th&aacute;i từ l&acirc;u đ&atilde; trở th&agrave;nh điểm hẹn l&yacute; tưởng của những buổi hội họp, li&ecirc;n hoan hay những bữa cơm gia đ&igrave;nh ấm c&uacute;ng sau mỗi ng&agrave;y l&agrave;m việc căng thẳng. Nh&agrave; H&agrave;ng Kim Th&aacute;i nằm tại tầng 15 của kh&aacute;ch sạn Kim Th&aacute;i, 1 trong những kh&aacute;ch sạn 3 sao h&agrave;ng đầu Th&aacute;i Nguy&ecirc;n. Đ&acirc;y l&agrave; điểm hẹn l&yacute; tưởng cho c&aacute;c kh&aacute;ch h&agrave;ng muốn trải nghiệm những điều mới lạ ngay giữa trung t&acirc;m th&agrave;nh phố.</p>\",\n  \"audioId\": \"clpi512z50009dr3n2zz07qdz\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:49:48.921', '2023-11-28 09:49:48.921'),
(248, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Nhà hàng', 'scene', '{\n  \"name\": \"Nhà hàng\",\n  \"slug\": \"nha_hang_2\",\n  \"description\": \"<p>Nằm trong khu vực c&oacute; nhiều nh&agrave; h&agrave;ng, qu&aacute;n ăn lớn, nổi tiếng nhưng nh&agrave; h&agrave;ng Kim Th&aacute;i lu&ocirc;n nhận được sự quan t&acirc;m đặc biệt của kh&aacute;ch h&agrave;ng. Điều n&agrave;y cho thấy nh&agrave; h&agrave;ng Kim Th&aacute;i kh&ocirc;ng chỉ l&agrave;m h&agrave;i l&ograve;ng thực kh&aacute;ch thưởng thức mỗi lần gh&eacute; đến m&agrave; c&ograve;n nhận được sự ủng hộ, tin tưởng v&agrave; đồng h&agrave;nh của qu&yacute; kh&aacute;ch h&agrave;ng trong suốt chặng đường ph&aacute;t triển của m&igrave;nh.</p>\",\n  \"audioId\": \"clpi53ylg000tdr3nd51wwo9i\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:50:08.843', '2023-11-28 09:50:08.843'),
(249, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Nhà hàng', 'scene', '{\n  \"name\": \"Nhà hàng\",\n  \"slug\": \"nha_hang_2\",\n  \"description\": \"<p>Nằm trong khu vực c&oacute; nhiều nh&agrave; h&agrave;ng, qu&aacute;n ăn lớn, nổi tiếng nhưng nh&agrave; h&agrave;ng Kim Th&aacute;i lu&ocirc;n nhận được sự quan t&acirc;m đặc biệt của kh&aacute;ch h&agrave;ng. Điều n&agrave;y cho thấy nh&agrave; h&agrave;ng Kim Th&aacute;i kh&ocirc;ng chỉ l&agrave;m h&agrave;i l&ograve;ng thực kh&aacute;ch thưởng thức mỗi lần gh&eacute; đến m&agrave; c&ograve;n nhận được sự ủng hộ, tin tưởng v&agrave; đồng h&agrave;nh của qu&yacute; kh&aacute;ch h&agrave;ng trong suốt chặng đường ph&aacute;t triển của m&igrave;nh.<br>Đến với nh&agrave; h&agrave;ng Kim Th&aacute;i, qu&yacute; kh&aacute;ch sẽ thật ấn tượng với kh&ocirc;ng gian v&ocirc; c&ugrave;ng rộng r&atilde;i v&agrave; tho&aacute;ng m&aacute;t nơi đ&acirc;y. Điều đặc biệt được nhắc đến khi n&oacute;i về nh&agrave; h&agrave;ng Kim Th&aacute;i đ&oacute; ch&iacute;nh l&agrave; kh&ocirc;ng gian, view ngắm trọn th&agrave;nh phố, cực chil v&agrave; thư gi&atilde;n.</p>\",\n  \"audioId\": \"clpi53ylg000tdr3nd51wwo9i\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:50:28.795', '2023-11-28 09:50:28.795'),
(250, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng tiệc', 'scene', '{\n  \"name\": \"Phòng tiệc\",\n  \"slug\": \"nha_hang\",\n  \"description\": \"<p>Ngo&agrave;i kh&ocirc;ng gian rộng lớn b&ecirc;n ngo&agrave;i với view mở c&ograve;n c&oacute; hệ thống ph&ograve;ng ri&ecirc;ng, đ&aacute;p ứng nhu cầu của kh&aacute;ch h&agrave;ng.<br>C&oacute; rất nhiều c&aacute;c m&oacute;n ăn trong thực đơn phong ph&uacute;, nhưng khi đến với nh&agrave; h&agrave;ng Kim Th&aacute;i qu&yacute; kh&aacute;ch sẽ kh&ocirc;ng thể bỏ qua c&aacute;c m&oacute;n ăn như: b&ograve; sốt rượu vang, c&aacute; hồi sốt chanh leo, b&ograve; b&iacute;t tết, c&aacute;c m&oacute;n g&agrave; từ truyền thống đến hiện đại.... Chắc chắn thưởng thức một lần th&igrave; sẽ kh&ocirc;ng thể n&agrave;o qu&ecirc;n được hương vị đặc trưng đ&oacute;. Ngo&agrave;i m&agrave;u sắc bắt mắt, l&ocirc;i cuốn, vị ngọt của c&aacute;c m&oacute;n ăn th&igrave; bạn c&ograve;n cảm nhận được vị vừa b&eacute;o, vừa ngọt, vị mằn mặn, đậm đ&agrave; của v&ocirc; v&agrave;n c&aacute;c m&oacute;n từ &Acirc;u đến &Aacute;.</p>\",\n  \"audioId\": \"clpi532jx000pdr3n215y9o9w\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:50:51.462', '2023-11-28 09:50:51.462'),
(251, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Sảnh phòng khách sạn', 'scene', '{\n  \"name\": \"Sảnh phòng khách sạn\",\n  \"slug\": \"sanh_2\",\n  \"description\": \"<p>Kh&aacute;ch sạn Kim Th&aacute;i được đầu tư với quy m&ocirc; 69 ph&ograve;ng c&oacute; diện t&iacute;ch đa dạng v&agrave; phong ph&uacute;, từ 24m2 - 66 m2, ph&ugrave; hợp với mọi nhu cầu của kh&aacute;ch h&agrave;ng. Mang lối kiến tr&uacute;c hiện đại, đầy đủ tiện nghi, nội thất sang trọng, đạt ti&ecirc;u chuẩn tr&ecirc;n 3 sao - Theo ti&ecirc;u chuẩn Quốc Tế.</p>\",\n  \"audioId\": \"clpi50p4k0005dr3n456agg5k\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 09:58:30.161', '2023-11-28 09:58:30.161');
INSERT INTO `admin_histories` (`id`, `status`, `action`, `title`, `tableName`, `data`, `adminId`, `createdAt`, `updatedAt`) VALUES
(252, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Phòng gia đình', 'scene', '{\n  \"name\": \"Phòng gia đình\",\n  \"slug\": \"4\",\n  \"description\": \"<p>Kh&ocirc;ng gian trong ph&ograve;ng tho&aacute;ng m&aacute;t, sạch sẽ, mỗi ph&ograve;ng đều c&oacute; cửa sổ lớn nh&igrave;n ra kh&ocirc;ng gian b&ecirc;n ngo&agrave;i với xa xa l&agrave; khung cảnh non nước hữu t&igrave;nh đầy thơ mộng, biểu tượng N&uacute;i Voi uy nghi, sừng sững v&agrave; cảnh đẹp lung linh của th&agrave;nh phố khi m&agrave;n đ&ecirc;m bu&ocirc;ng xuống nơi đ&acirc;y. Hơn thế nữa, &nbsp;Kh&aacute;ch sạn Kim Th&aacute;i c&ograve;n lựa chọn c&aacute;ch thiết kế độc đ&aacute;o, thuận tiện cho ph&ograve;ng VIP, Suite trong đ&oacute; ph&ograve;ng kh&aacute;ch v&agrave; ph&ograve;ng nghỉ được t&aacute;ch biệt với diện t&iacute;ch ph&ograve;ng l&ecirc;n đến 66m2. Trang thiết bị th&acirc;n thiện với m&ocirc;i trường v&agrave; tiết kiệm năng lượng sẽ l&agrave;m h&agrave;i l&ograve;ng mọi kh&aacute;ch h&agrave;ng cho d&ugrave; l&agrave; kh&oacute; t&iacute;nh nhất.</p>\",\n  \"audioId\": \"clpi6pdkl0015dr3n33cfakus\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 10:18:08.641', '2023-11-28 10:18:08.641'),
(253, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Sảnh phòng họp', 'scene', '{\n  \"name\": \"Sảnh phòng họp\",\n  \"slug\": \"sanh_phong_hop\",\n  \"description\": \"<p>Hệ thống ph&ograve;ng hội thảo Kim Th&aacute;i tọa lạc tại vị tr&iacute; trung t&acirc;m của th&agrave;nh phố. Thuận tiện cho việc t&igrave;m kiếm v&agrave; di chuyển của qu&yacute; kh&aacute;ch h&agrave;ng. Hơn hết, khi thu&ecirc; ph&ograve;ng hội thảo tại vị tr&iacute; trung t&acirc;m cũng thể hiện được sự uy t&iacute;n v&agrave; chuy&ecirc;n nghiệp của ban tổ chức. Từ kh&aacute;ch sạn di chuyển đến c&aacute;c cơ quan h&agrave;nh ch&iacute;nh trọng điểm của th&agrave;nh phố chỉ mất từ 3-5 ph&uacute;t. Tạo điều kiện dễ d&agrave;ng cho kh&aacute;ch h&agrave;ng kh&ocirc;ng mất qu&aacute; nhiều thời gian t&igrave;m kiếm.</p>\",\n  \"audioId\": \"clpi6r5h70017dr3nag4b5g6y\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 10:19:03.047', '2023-11-28 10:19:03.047'),
(254, 'success', 'Cập nhập', 'Chỉnh sửa điểm chụp Sảnh phòng họp', 'scene', '{\n  \"name\": \"Sảnh phòng họp\",\n  \"slug\": \"sanh_phong_hop_2\",\n  \"description\": \"<p>Ph&ograve;ng hội thảo của Kim Th&aacute;i c&oacute; diện t&iacute;ch rất đa dạng, phục vụ được to&agrave;n bộ nhu cầu về c&aacute;c chương tr&igrave;nh hội nghị, c&oacute; 3 ph&ograve;ng họp, hội thảo dao động từ 20 người, 50 người v&agrave; hội trường từ 100 - 120 người, sẽ đem đến cho qu&yacute; kh&aacute;ch h&agrave;ng nhiều sự lựa chọn ph&ugrave; hợp. C&aacute;c ph&ograve;ng đều c&oacute; kh&ocirc;ng gian sang trọng, gam m&agrave;u tinh tế, ph&ugrave; hợp với nhiều mục đ&iacute;ch sử dụng cho kh&aacute;ch h&agrave;ng.</p>\",\n  \"audioId\": \"clpi6rp9c0019dr3nddisnod6\",\n  \"publish\": \"publish\"\n}', 'clp9k09rv0002yk24qhzzxeat', '2023-11-28 10:19:29.151', '2023-11-28 10:19:29.151'),
